package test;
public class Consultor extends Persona{
    int numConsult;
    String consultoria;

    public Consultor() {}

    public Consultor(int numConsult, String consultoria, int id, String cc,
            String name, String lastName, String domicilio, String telefono) {
        super(id, cc, name, lastName, domicilio, telefono);
        this.numConsult = numConsult;
        this.consultoria = consultoria;
    }

    public int getNumConsult() {return numConsult;}
    public void setNumConsult(int numConsult) {this.numConsult = numConsult;}
    public String getConsultoria() {return consultoria;}
    public void setConsultoria(String consultoria) {this.consultoria = consultoria;}
    
}